import { useState, createElement as $ } from 'react';
import { Menu } from 'antd';
import {
	AppstoreOutlined,
	SettingOutlined,
	UserOutlined,
	UserAddOutlined,
} from '@ant-design/icons';
import { Link } from 'react-router-dom';

const { SubMenu, Item } = Menu;

const Header = () => {
	const [current, setCurrent] = useState('home');

	const handleClick = (e) => {
		console.log(e.key);
		setCurrent(e.key);
	};

	return $(
		Menu,
		{ onClick: handleClick, selectedKeys: [current], mode: 'horizontal' },
		$(
			Link,
			{ to: '/' },
			$(Item, { key: 'home', icon: $(AppstoreOutlined) }, 'Home')
		),
		$(
			SubMenu,
			{ icon: $(SettingOutlined), title: 'Username' },
			$(Link, { to: '/' }, $(Item, { key: 'setting:1' }, 'Option 1')),
			$(Link, { to: '/' }, $(Item, { key: 'setting:2' }, 'Option 2'))
		),
		$(
			Link,
			{ to: '/register' },
			$(
				Item,
				{ key: 'register', icon: $(UserAddOutlined), className: 'float-right' },
				'Register'
			)
		),
		$(
			Link,
			{ to: '/login' },
			$(
				Item,
				{ key: 'login', icon: $(UserOutlined), className: 'float-right' },
				'Login'
			)
		)
	);
};

export default Header;
